  ///  Cargar datos en el PDF (Inventario)  ///
  async PDFInventario(creador, fechaEntrega, tipo, numDocument, codigo) {
    // const data = [['Insumo', 'Cantidad', 'C贸digo']];
    this.inventarioCollection = this.afs.collection('Inventario');
    this.inventarioCollection.valueChanges();
    this.data = [];

    const userDoc = this.inventarioCollection;
    userDoc.get().subscribe((querySnapshot) => {
    querySnapshot.forEach((doc => {
      // console.log(doc.id, '=>', doc.data());
      this.data.push(doc.data());
    }));
    this.generarPDF(creador.value , fechaEntrega.value, tipo.value, numDocument.value, codigo.value);
  });
  }

