  //  M茅todo para abrir el PDF  ///
  async openPDF() {
    const loading = await this.loadingCtrl.create({
      mode: 'ios',
      message: 'Generando PDF...',
      spinner: 'lines-small'
    });
    await loading.present();
    if (this.platform.is('cordova')) {
      this.pdf.getBuffer((buffer) => {
        const blob = new Blob([buffer], {
          type: 'application/pdf'
        });
        this.file
          .writeFile(this.file.dataDirectory, 'Inventario.pdf', blob, {
            replace: true
          })
          .then(async (fileEntry) => {
            this.AlertaExitoPDF();
            this.fileOpener.open(
              this.file.dataDirectory + 'Inventario.pdf',
              'application/pdf'
            );
          });
      });
      loading.dismiss();
      return true;
    }
    this.pdf.download();
    loading.dismiss();
  }



